        options={{ max: 55 }}
        style={{ height: 150, width: 150 }}
      >
        {/* <div className="Tilt-inner"> ğŸ§šâ€â™‚ï¸</div> */}
        <div className="Tilt-inner pa3">
          <img style={{ paddingTop: "5px" }} alt="logo" src={brain} />
